import React from 'react';
im
const FlipCard = ({ image, title, details, hue }) => {
  return (
    <div className="flip-card-container" style={{ '--hue': hue }}>
      <div className="flip-card">
        <div className="card-front">
          <figure>
            <div className="img-bg"></div>
            <img src={image} alt={title} />
            <figcaption>{title}</figcaption>
          </figure>
          <ul>
            {details.map((detail, index) => (
              <li key={index}>{detail}</li>
            ))}
          </ul>
        </div>

        <div className="card-back">
          <figure>
            <div className="img-bg"></div>
            <img src={image} alt={title} />
          </figure>
          <button>Book</button>

          <div className="design-container">
            <span className="design design--1"></span>
            <span className="design design--2"></span>
            <span className="design design--3"></span>
            <span className="design design--4"></span>
            <span className="design design--5"></span>
            <span className="design design--6"></span>
            <span className="design design--7"></span>
            <span className="design design--8"></span>
          </div>
        </div>
      </div>
    </div>
  );
};

const FlipCardList = () => {
  const cards = [
    {
      image: 'https://images.unsplash.com/photo-1486162928267-e6274cb3106f?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60',
      title: 'Brohm Lake',
      details: ['Detail 1', 'Detail 2', 'Detail 3', 'Detail 4', 'Detail 5'],
      hue: 220,
    },
    {
      image: 'https://images.unsplash.com/photo-1545436864-cd9bdd1ddebc?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60',
      title: 'Légende',
      details: ['Detail 1', 'Detail 2', 'Detail 3', 'Detail 4', 'Detail 5'],
      hue: 170,
    },
    {
      image: 'https://images.unsplash.com/photo-1486162928267-e6274cb3106f?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60',
      title: 'Brohm Lake',
      details: ['Detail 1', 'Detail 2', 'Detail 3', 'Detail 4', 'Detail 5'],
      hue: 350,
    },
  ];

  return (
    <div className="flip-card-list">
      {cards.map((card, index) => (
        <FlipCard
          key={index}
          image={card.image}
          title={card.title}
          details={card.details}
          hue={card.hue}
        />
      ))}
    </div>
  );
};

export default FlipCardList;
